B.AN=A.a(s(["Eine Erh\xf6hung des Stromes IB0 am Eingang f\xfchrt zun\xe4chst zu einem Anstieg des Stromes IC im Ausgangskreis. Gleichzeitig verringert sich die Spannung UCE am Ausgang, da der Spannungsabfall \xfcber Rc gr\xf6\xdfer wird.","Erh\xf6ht man das Eingangssignal immer weiter, wird die Spannung UCE am Ausgang sehr klein, so dass die Basis-Kollektor Diode schlie\xdflich in Durchlassrichtung geschaltet wird und der Transistor in S\xe4ttigung geht. Dadurch verringert sich die Stromverst\xe4rkung B. Der Strom IC steigt dann trotz weiterer Zunahme von IB0 nicht mehr weiter an.","Wird der Eingang des Verst\xe4rkers mit einem Sinussignal angesteuert (AC on), so muss ein geeigneter Eingangsruhestrom IB0 eingestellt werden, damit das Sinussignal vollst\xe4ndig \xfcbertragen wird."]),t.i)
