B.Ce=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Bor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (dreiwertige) B-Atome, so gehen jeweils die drei Elektronen des Bor-Atoms (B) eine Bindung mit den benachbarten Si-Atomen ein.","Da bei dem Boratom ein Elektron zur Bindung fehlt, existiert an dieser Stelle eine L\xfccke, die zun\xe4chst noch an das Boratom gebunden ist. Es gen\xfcgt jedoch bereits eine sehr geringe Energiezufuhr (z.B. geringe Temperaturerh\xf6hung), damit sich ein vorher im Kristallgitter gebundenes Valenzelektron in diese L\xfccke setzt, d.h. an das Boratom (den so genannten Akzeptor) bindet. Dadurch entsteht an der Stelle, an der vorher das Valenzelektron sa\xdf, ein freies Loch, in das wiederum ein anderes Elektron springen kann. Die geringe Ionisierungsenergie des Boratoms entspricht im B\xe4nderdiagramm dem geringen Abstand des Energieniveaus des Akzeptors Wa zum Valenzband Wv.","Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (hier: 100K) alle Boratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien L\xf6cher po gleich der Dichte NA der Dotierungsatome ist.","Der negative Atomrumpf (B-) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Es erh\xf6ht sich demnach nur die Anzahl der freien L\xf6cher, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Bor dotierten Halbleiter die freien L\xf6cher ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem p-Typ Halbleiter."]),t.i)
B.uX=new A.jr("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Bor) die Anzahl der freien L\xf6cher erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.Ce,null)
B.Bn=A.a(s(["Eine Polstelle bewirkt einen Abfall des Betrages der \xdcbertragungsfunktion ab einer Grenzfrequenz, die von der Lage des Pols abh\xe4ngt. Je n\xe4her der Pol an der komplexen Achse liegt, um sehr niedriger ist die entsprechende Grenzfrequenz. Ebenfalls erfolgt eine Phasendrehung bei der Grenzfrequenz um -90 Grad.","Eine Nullstelle bewirkt einen Anstieg des Betrages der \xdcbertragungsfunktion sowie eine Phasendrehung um +90 Grad bei der zu der Nullstelle geh\xf6renden Grenzfrequenz.","Existieren mehrere Pol- oder Nullstellen, so \xfcberlagern sich deren Wirkungen. Insbesondere kompensieren sich Null- und Polstellen gegenseitig, wenn sie an der gleichen Stelle in der komplexen Ebene liegen.","Konjugiert komplexe Pole f\xfchren wegen des imagin\xe4ren Anteils zu Sinus- und Cosinus-Anteilen in der Sprungantwort. Der Realteil f\xfchrt zu einer exponentiellen D\xe4mpfung, wenn die Polstelle in der linken Halbebene liegt und zu einer ansteigenden Schwingung, wenn der Realteil des Poles positiv ist."]),t.i)
B.uY=new A.jr("Dieses Applet zeigt den Einfluss der Lage von Pol- (x) und Nullstellen (o) einer komplexen \xdcbertragungsfunktion auf den Amplituden- und Phasengang sowie die Sprungantwort. Im unteren, linken Fenster des Applets lassen sich Pol- und Nullstellen hinzuf\xfcgen, verschieben und l\xf6schen.\n        \nMan sieht: \n        ",B.Bn,null)
B.BD=A.a(s(["F\xfcr die gezeigte Schaltung kann die \xdcbertragungskennlinie grafisch konstruiert werden, indem das Ausgangskennlinienfeld IC=IC(UCE,UBE) des Transistors und die Kennlinie IC(UCE) des Widerstandes in ein Diagramm eingetragen werden. F\xfcr einen gegebenen Wert von UBE ergibt dann der Schnittpunkt der entsprechenden Transistorkennlinie mit der Widerstandsgeraden den dazugeh\xf6rigen Wert f\xfcr UCE.","Die Steigung dUCE/dUBE der \xdcbertragungskennline entspricht der Kleinsignalspannungsverst\xe4rkung Au. F\xfcr Werte UBE unter etwa 0,6V ist die Steigung und damit die Verst\xe4rkung etwa Null, da der Transistor sperrt. F\xfcr gro\xdfe Werte von UBE geht die Verst\xe4rkung ebenfalls gegen Null, da der Transistor in S\xe4ttigung geht."]),t.i)
B.uZ=new A.jr("Dieses Applet zeigt die Konstruktion der \xdcbertragungskennlinie UCE.\n\nMan sieht:\n",B.BD,null)
B.BV=A.a(s(["Durch Bestrahlung werden Ladungstr\xe4gerpaare im Innern der Fotodiode generiert. Eine Erh\xf6hung der Bestrahlungsst\xe4rke Ee f\xfchrt zu einem Anstieg der Generationsrate und somit zu einer h\xf6heren Anzahl freier Ladungstr\xe4ger. Umgekehrt f\xfchrt eine Verringerung der Bestrahlungsst\xe4rke zu einer Verringerung der Generationsrate.","Die durch die Bestrahlung generierten Ladungstr\xe4ger werden durch das eingebaute elektrische Feld E der Raumladungszone sofort getrennt und zu den neutralen Bahngebieten hin abtransportiert, ohne dass dazu eine externe Spannung notwendig ist. Der Fotostrom steht daher direkt an den Elektroden der Fotodiode zur Verf\xfcgung. Der Fotostrom ist proportional zu der Bestrahlungsst\xe4rke Ee und in erster N\xe4herung unabh\xe4ngig von der angelegten Spannung U (der Grund hierf\xfcr ist, dass das eingebaute elektrische Feld E der Raumladungszone bereits gro\xdf genug ist, um die Ladungstr\xe4ger auf ihre S\xe4ttigungsgeschwindigkeit zu beschleunigen. Eine weitere Erh\xf6hung des elektrischen Feldes durch \xc4nderung der Spannung U f\xfchrt dann zu keiner weiteren Erh\xf6hung der Geschwindigkeit der Ladungstr\xe4ger - und damit zu keinem Anstieg des Stromes)."]),t.i)
B.v_=new A.jr("Dieses Applet veranschaulicht die Funktion einer Fotodiode. Die in der linken Bildh\xe4lfte des Applets schematisch dargestellte Fotodiode besitzt eine pin-Struktur, d.h. zwischen dem p- und dem n-Gebiet liegt ein undotiertes (intrinsisches) i-Gebiet (grau dargestellt). Das p- und das n-Gebiet bewirken eine \xfcber das gesamte i-Gebiet ausgedehnte Raumladungszone mit einer hohen elektrischen Feldst\xe4rke E. Aus Gr\xfcnden der \xdcbersichtlichkeit werden nur die durch Bestrahlung generierten freien Ladungstr\xe4ger animiert. Die rechte Bildh\xe4lfte des Applets zeigt die Strom-Spannungs Kennlinie des Bauelementes, wobei der aktuelle Arbeitspunkt durch einen roten Punkt gekennzeichnet ist. Hellgrau schattiert ist der dritte Quadrant der Kennlinie (U<0 und I<0); in diesem Quadranten arbeitet die Fotodiode im Diodenbetrieb. Mit Hilfe der vier Schaltfl\xe4chen im unteren Bereich des Applets k\xf6nnen die Bestrahlungsst\xe4rke Ee sowie die angelegte Spannung U variiert werden.\nMan sieht:\n",B.BV,null)
B.BR=A.a(s(["Das Anlegen einer Drain-Source Spannung UDS f\xfchrt nur dann zu einem Strom IDS durch den Transistor, wenn die Gate-Source Spannung UGS gr\xf6\xdfer ist als die Einsatzspannung Uth,n, da sich erst dann ein leitender Kanal unter dem Gate bildet.","\xdcberschreitet die Gate-Source Spannung UGS die Einsatzspannung Uth,n, so bildet sich ein leitender Kanal unterhalb des Gates und es kann ein Strom flie\xdfen, wenn eine Spannung UDS angelegt wird.","Der Strom IDS steigt - bei konstantem UGS - zun\xe4chst mit gr\xf6\xdfer werdender Spannung UDS stark an. Diesen Bereich bezeichnet man als Widerstandsbereich.","Mit gr\xf6\xdfer werdender Spannung UDS erreicht der Strom jedoch einen S\xe4ttigungswert und steigt dann nur noch geringf\xfcgig an. Dieser Bereich wird als S\xe4ttigungsbereich bezeichnet."]),t.i)
B.v0=new A.jr("Dieses Applet veranschaulicht die Funktionsweise des Feldeffekttransistors, der aus einer MOS-Struktur mit anschlie\xdfenden Source und Drain-Gebieten besteht. Nach Vorgabe der Gate-Source-Spannung UGS und der Drain-Source-Spannung UDS wird der Strom IDS durch den Transistor berechnet. Der entsprechende Arbeitspunkt wird im Ausgangskennlinienfeld als roter Punkt eingezeichnet. Zus\xe4tzlich wird der Kanal unter dem Gate dargestellt, um Effekte wie Kanalabschn\xfcrung und Kanall\xe4ngenmodulation sowie die Wirkung der Einsatzspannung (hier: Uth,n=0.8V) zu verdeutlichen.\nMan sieht:\n",B.BR,null)
